import './App.css';
import Header from './screens/templates/header'
//import LastPropertyForSales from './screens/components/lastPropertyForSales'

import React, { useEffect, useState } from 'react';
import Properties from './screens/components/Properties';

function App() {

  /*
  render() {
    const { properties } = this.state
    return(
      <div className="propertiesList">
        {
          properties.map((property, index) => (
            <Property
              property={property}
              index={index}
              key={index}
            />
          ))
        }
      </div>
    )
  }*/

  const [properties, setProperties] = useState({})

  useEffect(() => {
    async function fetchData() {
      const res = fetch("http://localhost:8000/api/v1/properties")
      .then(res => res.json())
      .then(res => setProperties(res))
      .catch(err => console.log(err))
    }

    fetchData()
  })

  return (
    <div className="App">
        <Header />
        <h1>Properties list</h1>
        <span>{JSON.stringify(properties)}</span>       
    </div>
  );


}

export default App;
